    const MAX = 2.0;
    const pace = 1.0;


function Pace() {
  state = {
    pace: [90],
  };
  return (
    <div>
      <label>
        <strong>Pace&nbsp;&nbsp;</strong>
       <Range 
            values = {this.state.values}
            step = {STEP}
            min = {MIN}
            max = {MAX}
            onChange={(pace) => this.setState({ pace })}


       />
        <input type="range" id="pace" min="0.1" max="2.0"></input>
        &nbsp;&nbsp;1&nbsp;x
      </label>
    </div>
  );}


export default Pace
